import React from "react";

import { Unstable_Grid2 as Grid } from "@mui/material";

import CustomTextField from "./CustomTextField";
import CustomSelector from "./CustomSelector";

const BasicStaffDataGrid = (props) => {
  const { register, errors } = props;
  return (
    <Grid container p={2} spacing={3}>
      <Grid item xs={4}>
        <CustomTextField
          dataKey="name"
          type="text"
          register={register}
          isRequired={true}
          name="Όνομα"
          errors={errors}
        />
      </Grid>
      <Grid item xs={4}>
        <CustomTextField
          dataKey="surname"
          type="text"
          register={register}
          isRequired={true}
          name="Επώνυμο"
        />
      </Grid>
      <Grid item xs={4}>
        <CustomTextField
          dataKey="asma"
          type="number"
          step="1"
          register={register}
          isRequired={true}
          name="ΑΣΜΑ"
        />
      </Grid>
      <Grid item xs={4}>
        <CustomSelector
          name="Σώμα"
          register={register}
          items={["ΠΟΛΕΜΙΚΗ ΑΕΡΟΠΟΡΙΑ", "ΣΤΡΑΤΟΣ ΞΗΡΑΣ", "ΠΟΛΕΜΙΚΟ ΝΑΥΤΙΚΟ"]}
        />
      </Grid>
      <Grid item xs={4}>
        <CustomTextField
          dataKey="specialization"
          type="text"
          register={register}
          isRequired={true}
          name="Ειδικότητα"
        />
      </Grid>
      <Grid item xs={4}>
        <CustomTextField
          dataKey="rank"
          type="text"
          register={register}
          isRequired={true}
          name="Βαθμός"
        />
      </Grid>
      <Grid item xs={6}>
        <CustomTextField
          dataKey="mobile_phone"
          type="tel"
          pattern="69[0-9]{8}"
          register={register}
          isRequired={true}
          name="Κινητό Τηλέφωνο"
        />
      </Grid>
      <Grid item xs={6}>
        <CustomTextField
          dataKey="work_phone"
          type="tel"
          pattern="[0-9]{4}"
          register={register}
          isRequired={false}
          name="Υπηρεσιακό Τηλέφωνο"
        />
      </Grid>
    </Grid>
  );
};

export default BasicStaffDataGrid;
